import React, { useState } from "react";
import './LoginPage.css'

function LoginPage() {
    const [email, setEmail] = useState("")
    const [password, setPassword] = useState("")

    const handleSubmit = (e) => {
        console.log(email, password)
    }

    return (
        // <form onSubmit={handleSubmit}>
        //     <label className="form-label">Email address</label>
        //     <input type="email" className="form-control" value={email} onChange={(e) => setEmail(e.target.value)} />
        //     <label className="form-label">Password</label>
        //     <input type="password" className="form-control" value={password} onChange={(e) => setPassword(e.target.value)} />
        //     <button type="submit" className="btn btn-primary w-25 " >Login</button>
        // </form>

        <div className="loginPage">
            <div className='card'>
                <form className="loginForm" onSubmit={handleSubmit} >
                    <div className="row">
                        <div className="titleForm text-center mb-4">
                            <h1 className="fw-bold fw-5">Login</h1>
                            <p>Login For Dashboard</p>
                        </div>

                        <div className="mb-3">
                            <label for="exampleFormControlInput1" className="form-label">Email address</label>
                            <input type="email" className="form-control" id="exampleFormControlInput1"
                                placeholder="name@example.com" value={email} onChange={(e) => setEmail(e.target.value)} />
                        </div>
                        <div className="mb-3">
                            <label for="exampleFormControlInput1" className="form-label">Password</label>
                            <input type="password" className="form-control" id="exampleFormControlInput1"
                                placeholder="**********" required value={password} onChange={(e) => setPassword(e.target.value)} />
                        </div>
                    </div>
                    <a href="#" className="d-block mb-3">Forget Password</a>
                    <button type="submit" class="btn btn-primary w-25">Login</button>
                </form>
            </div>
        </div>
    );
}

export default LoginPage;
